  import React from 'react'
  import { MDXTag } from '@mdx-js/tag'
  import { PropsTable, Playground } from 'docz';
import MessageList from './MessageList.tsx'
import placeholderAvatarJpg from "../../assets/placeholderImages/placeholderAvatar.jpg";
const date = new Date();

export default ({components, ...props}) => <MDXTag name="wrapper"  components={components}>
<MDXTag name="h1" components={components} props={{"id":"messagelist"}}>{`MessageList`}</MDXTag>
<MDXTag name="h2" components={components} props={{"id":"basic-usage"}}>{`Basic Usage`}</MDXTag>
<Playground __position={0} __code={`<MessageList
  avatar={placeholderAvatarJpg}
  currentUser={\'userUniqueID\'}
  content={\'Message from the server\'}
  deleteMessage={event => event.preventDefault()}
  id={\'message.roomId\'}
  sentAt={\`${date}\`}
  userId={\'message.userId\'}
  username={\'Guest User\'}
/>`} __scope={{props,MessageList,placeholderAvatarJpg}} >
  <MessageList
    avatar={placeholderAvatarJpg}
    currentUser={'userUniqueID'}
    content={'Message from the server'}
    deleteMessage={event => event.preventDefault()}
    id={'message.roomId'}
    sentAt={`${date}`}
    userId={'message.userId'}
    username={'Guest User'}
  />
</Playground>
<MDXTag name="hr" components={components}></MDXTag>
<MDXTag name="h2" components={components} props={{"id":"properties"}}>{`Properties`}</MDXTag>
<PropsTable of={MessageList} /></MDXTag>
